import React from 'react'
import styled from 'styled-components'
import MenuIcon from '@mui/icons-material/Menu';

function Header() {
  return (
    <Container>
    
    <a>
      <img src="/Images/logo.svg"/>
    </a>
    <Menu>
      <a href="#">Model S</a>
       <a href="#">Model Y</a>
       <a href="#">Model X</a>
       <a href="#">Model 3</a>
    </Menu>

    <RightMenu>
      <a href="#">Shop</a>
      <a href=" #"> Tesla Account</a>
      <CustomMenu/>
    </RightMenu>
    </Container>
  )
}

export default Header

const Container = styled.div`
 min-height: 60px;
 position: Fixed;
 display: flex;
 align-items: center;
 justify-content: space-between;
 padding: 0 20px;
 top: 0;
 left: 0;
 right: 0;
`

const Menu = styled.div`
display: flex;
align-items: center;
flex: 1;
justify-content: center;
a  {
  padding: 0 20px;
  font-weight: 600;
  text-transform: uppercase;
  flex-wrap: nowrap;
}
@media (max-width: 768px) {
  display: none;
}
`

const RightMenu = styled.div`
 display: flex;
 align-items: center;
a  {
  margin-right: 20px;
  font-weight: 600;
  text-transform: uppercase;
  
}
`

const CustomMenu = styled(MenuIcon)`
   cursor: pointer;
`
